import React from 'react'
import { NavLink } from 'react-router-dom'
import * as ROUTES from '../../constants/routes'
import styled from 'styled-components'

import Button from '../../style/FormUI/Buttons.js'
import profile from '../../images/Alexandra.jpg'


const Heading = styled.div`
    width: 100%;
    height: 6rem;
    background-color: var(--color-main)
`
const StyledImage = styled.img`
    position: absolute;
    border-radius: 50%; 
    align-items: center;
    display: block;
    margin: 2rem
    width: 10rem;
    height: 10rem;
    object-fit: cover;
    transition: all 0.3s;
`

const Profile = () => {
    return (
        <>
            <Heading/>
            <div> Code goes here </div>
            <StyledImage src = {profile} alt = "Profile" />
            <NavLink to = {ROUTES.PROFILE_EDIT}><Button> Edit Profile </Button></NavLink>
        </>
    )
}

export default Profile
